function FinishScreen({ points, maxPossiblePoints }) {
	const percentage = points / maxPossiblePoints; //
	return (
		<p className="result">
			You score <strong>{points}</strong> out of {maxPossiblePoints} (
			{Math.ceil(percentage)})
		</p>
	);
}

export default FinishScreen;
